import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Table, Button } from 'react-bootstrap';
import Example from "../Modal/Modal";

const Tabel = (props) => {

    const data = props.dataDatas;

    return(

        <Container> 
        <Example />
        <Table striped bordered hover variant="dark">
            <thead>
                <tr>
                <th>Nama</th>
                <th>Email</th>
                <th>Action</th>
                </tr>
            </thead>
            <tbody>
            {data.map(datas => {
                                return(
                                    <tr>
                                        <td>{datas.Nama}</td>
                                        <td>{datas.Email}</td>
                                        <td><Button as="input" type="reset" value="reset"/><p>&ensp;</p><Button variant="dark">Delete</Button></td>
                                    </tr>
                                );
                            })
                            }
            </tbody>
        </Table>
    </Container>
    );
}
export default Tabel;
